description:
5 june 2012

Alexis and her boytoy decide to spend the weekend at a secluded bed and breakfast in the middle of nowhere. Alexis, however, is a
spoiled little bitch and is none too pleased to discover that their B&amp;B is not the four-star resort she was expecting. The place in question is run
by the mysterious Jayden. Single and unmarried in a town with little action, the question begs to be asked, how does she get laid. The secrets behind
her B&amp;B are revealed and much more in this mufftacular scene!

